import React from 'react'
import Modal from '@material-ui/core/Modal';
import FormControl from '@material-ui/core/FormControl';
import Typography from '@material-ui/core/Typography';
import Input from '@material-ui/core/Input';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Paper from '@material-ui/core/Paper'
import TextField from '@material-ui/core/TextField';
import DateFnsUtils from '@date-io/date-fns';
import {
    MuiPickersUtilsProvider,
    KeyboardTimePicker,
    KeyboardDatePicker,
} from '@material-ui/pickers';


const ModalEdit = ({ is_open, close }) => (
    <Modal
        open={is_open}
        onClose={() => close()}
        // style={{ display: 'flex', alignItems: 'center', padding: '20vw' }}
    >
        <Paper style={{
            width: '100%',
            marginTop: 15,
            // padding: 20,
            overflowX: 'auto',
            top: 50 + rand(),
            left: 50 + rand()
        }}>
            <Typography variant="h6" id="tableTitle" style={{ padding: 15, borderBottom: "solid 1px #dedede" }}>
                Edição de Despesas
        </Typography>
            <form style={{ margin: 40, display: 'flex', flexDirection: "column" }}>
                <TextField
                    label="Descrição"
                    id="margin-none"
                    fullWidth
                // defaultValue="Default Value"
                // className={classes.textField}
                // helperText="Some important text"
                />
                <FormControl style={{ marginTop: 20 }}>
                    {/* <InputLabel htmlFor="adornment-amount">Amount</InputLabel> */}
                    <Input
                        id="adornment-amount"
                        type="number"
                        // value={values.amount}
                        // onChange={handleChange('amount')}
                        startAdornment={<InputAdornment position="start">R$</InputAdornment>}
                    />
                </FormControl>
                <div style={{display: "flex", justifyContent: "space-around"}}>
                    <FormControlLabel
                        control={
                            <Checkbox
                                checked={true}
                                // onChange={handleChange('checkedG')}
                                value="checkedG"
                                color="primary"
                            />
                        }
                        label="Pago"
                        style={{ marginTop: 20 }}
                    />
                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                        <KeyboardDatePicker
                            margin="normal"
                            id="mui-pickers-date"
                            label="Date picker"
                            // value={selectedDate}
                            // onChange={handleDateChange}
                            KeyboardButtonProps={{
                                'aria-label': 'change date',
                            }}
                        />
                    </MuiPickersUtilsProvider>
                </div>
            </form>
        </Paper>
    </Modal>
)

export default ModalEdit
